import React from 'react';

import { NavLink } from 'react-router-dom';
import '../../css/navigation.css';

const Navigation = () => {
  return (
    <div className="navbar">
      <NavLink to="/" className="button navbarButton">Home</NavLink>
      <NavLink to="/designer" className="button navbarButton">Designer</NavLink>
    </div>
  );
}

export default Navigation;
